import React, { useState, useEffect } from 'react';
import Navbar from './Navbar';
import SurveyList from './SurveyList';
import Footer from './Footer';
import 'bootstrap/dist/css/bootstrap.min.css';

const Projects = () => {
  const [surveys, setSurveys] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Cargar encuestas
  useEffect(() => {
    fetchSurveys();
  }, []);

  const fetchSurveys = async () => {
    try {
      setLoading(true);
      const response = await fetch('http://localhost:5000/api/projects/asAihegkymxCu2hjw4UDTD/responses');
      if (!response.ok) {
        throw new Error('Error al obtener las encuestas');
      }
      const data = await response.json();
      setSurveys(data);
      setLoading(false);
    } catch (err) {
      setError(err.message);
      setLoading(false);
    }
  };

  if (loading) {
    return <div className="text-center mt-4">Cargando...</div>;
  }

  if (error) {
    return (
      <div className="container mt-4">
        <p className="text-danger">Error: {error}</p>
        <button className="btn btn-primary" onClick={fetchSurveys}>
          Reintentar
        </button>
      </div>
    );
  }

  return (
    <div>
      <Navbar />
      <SurveyList surveys={surveys} onBack={() => setSurveys([])} />
      <Footer />
    </div>
  );
};

export default Projects;
